import styled from "styled-components";
import COLOR from "./COLOR";
import BoxShadow from "./StyleComponents";

const MySkillContainer = styled.div`
    width: 44.8rem;
    height: 19.4rem;
    border-radius: 0.8rem;
    ${BoxShadow}
    background-color: ${COLOR.White};
    grid-column: 1/4;
    grid-row: 3/4;
    padding: 1.6rem;
`;
const H2 = styled.h2`
    font-size: 20px;
    font-weight: 500;
`;

function MySkill() {
    return (
        <MySkillContainer>
            <H2>My Skills</H2>
        </MySkillContainer>
    )
}

export default MySkill;
